import React from 'react';
import '../styles/entrepeneur.css';

class Entrepeneur extends React.Component{
    render() {
        return (
            <section className='entrepeneurSection'>
                <img src='https://i.pinimg.com/originals/75/42/83/7542837f7dac67557d4d9311a0646425.png' className='entrepeneur' alt=''/>
            </section>
        )
    }
}

export default Entrepeneur;
